   var Ktjalancirebonstyle = {
      "color": "#776B5D", 
      "weight": 3,
      "opacity": 0.75
   };
   L.geoJSON(Geojsonktcirebon, {
      style: Ktjalancirebonstyle,
      onEachFeature: function (Feature, layer) {
         layer.bindPopup(' '+Feature.properties.REMARK);
      }
   }).addTo(map);

